So nehmen Sie die Blutsauerstoffmessung vor:
1. Tragen Sie die Uhr eine Fingerbreite unterhalb des Handgelenksknochens und tragen Sie sie in einer bequemen Position am Handgelenk; 
2. Halten Sie nach dem Aufrufen des Blutsauerstoff-Erkennungsmodus ruhig, stellen Sie sicher, dass Ihr Handgelenk flach ist und die Uhr nach oben zeigt. Wenn Sie sitzen, können Sie Ihre Arme mit der Uhr nach oben auf den Tisch legen; 
3. Bitte halten Sie Ihren Arm ruhig, bis Sie das Endergebnis erhalten.
